import React from 'react';
import styles from '../style.module.css';
import image from '../Login.jpg'

function Picture(){
    return(<div className={styles.leftcenteredcontainer}>
        <img src={image} alt="Swap Clothes" className={styles.centered-image}/>
    </div>)
}

export default Picture;
